import React from 'react';
import { Card, ListGroup } from 'react-bootstrap';

const StockInfo = ({ info }) => {
  if (!info || typeof info !== 'object') {
    return (
      <Card>
        <Card.Header>
          <h5 className="mb-0">Stock Information</h5>
        </Card.Header>
        <Card.Body>
          <p className="text-muted">No stock information available</p>
        </Card.Body>
      </Card>
    );
  }

  // Safe data extraction with defaults
  const safeGet = (obj, path, defaultValue = 'N/A') => {
    try {
      const value = path.split('.').reduce((o, key) => (o && o[key] !== undefined ? o[key] : undefined), obj);
      return value !== undefined ? value : defaultValue;
    } catch {
      return defaultValue;
    }
  };

  const formatNumber = (num) => {
    if (num === undefined || num === null || isNaN(num)) return 'N/A';
    if (num >= 1e12) return `$${(num / 1e12).toFixed(2)}T`;
    if (num >= 1e9) return `$${(num / 1e9).toFixed(2)}B`;
    if (num >= 1e6) return `$${(num / 1e6).toFixed(2)}M`;
    if (num >= 1e3) return `$${(num / 1e3).toFixed(2)}K`;
    return `$${Number(num).toFixed(2)}`;
  };

  const formatPrice = (price) => {
    return price !== undefined && price !== null && !isNaN(price) 
      ? `$${Number(price).toFixed(2)}` 
      : 'N/A';
  };

  const companyName = safeGet(info, 'company_name', safeGet(info, 'longName', 'N/A'));
  const currentPrice = safeGet(info, 'current_price', safeGet(info, 'regularMarketPrice', 0));
  const marketCap = safeGet(info, 'market_cap', safeGet(info, 'marketCap', 0));
  const peRatio = safeGet(info, 'pe_ratio', safeGet(info, 'trailingPE', 0));
  const dividendYield = safeGet(info, 'dividend_yield', safeGet(info, 'dividendYield', 0));
  const volume = safeGet(info, 'volume', safeGet(info, 'regularMarketVolume', 0));
  const dayHigh = safeGet(info, 'day_high', safeGet(info, 'dayHigh', 0));
  const dayLow = safeGet(info, 'day_low', safeGet(info, 'dayLow', 0));
  const fiftyTwoWeekHigh = safeGet(info, 'fifty_two_week_high', safeGet(info, 'fiftyTwoWeekHigh', 0));
  const fiftyTwoWeekLow = safeGet(info, 'fifty_two_week_low', safeGet(info, 'fiftyTwoWeekLow', 0));

  return (
    <Card>
      <Card.Header>
        <h5 className="mb-0">Stock Information</h5>
      </Card.Header>
      <ListGroup variant="flush">
        <ListGroup.Item>
          <strong>Company:</strong> {companyName}
        </ListGroup.Item>
        <ListGroup.Item>
          <strong>Current Price:</strong> {formatPrice(currentPrice)}
        </ListGroup.Item>
        <ListGroup.Item>
          <strong>Market Cap:</strong> {formatNumber(marketCap)}
        </ListGroup.Item>
        <ListGroup.Item>
          <strong>P/E Ratio:</strong> {peRatio ? Number(peRatio).toFixed(2) : 'N/A'}
        </ListGroup.Item>
        <ListGroup.Item>
          <strong>Dividend Yield:</strong> {dividendYield ? `${(dividendYield * 100).toFixed(2)}%` : 'N/A'}
        </ListGroup.Item>
        <ListGroup.Item>
          <strong>Volume:</strong> {formatNumber(volume)}
        </ListGroup.Item>
        <ListGroup.Item>
          <strong>Day Range:</strong> {formatPrice(dayLow)} - {formatPrice(dayHigh)}
        </ListGroup.Item>
        <ListGroup.Item>
          <strong>52 Week Range:</strong> {formatPrice(fiftyTwoWeekLow)} - {formatPrice(fiftyTwoWeekHigh)}
        </ListGroup.Item>
      </ListGroup>
    </Card>
  );
};

export default StockInfo;
